import './List.css';

// List
export default function ReturnList(props) {
 return (
  <>
   <div className='wrp-list-left-print'>

    <ul>
     <li>Federation</li>
     <li>Section</li>
     <li>Cellule</li>
     <li>Sous-Cellule</li>
    </ul>

   </div>


   <div className='wrp-list-right-print'>
    <ul>
     <li>: {props.federation}</li>
     <li>: {props.section}</li>
     <li>: {props.cell}</li>
     <li>: {props.subcell}</li>
    </ul>

   </div>
  </>
 );
};
